import React, {Components} from 'react'
import {Nav} from 'react-bootstrap'
import PRODUCTS from '../products';

class Left extends React.Component{
    render(){
      const allProducts = Object.values(PRODUCTS)
      const clothes = Object.values(PRODUCTS).filter(item => item.category === 'Clothes')
      const household = Object.values(PRODUCTS).filter(item => item.category === 'Household')
      const office = Object.values(PRODUCTS).filter(item => item.category === 'Office')
      const food = Object.values(PRODUCTS).filter(item => item.category === 'Food')
      const other = Object.values(PRODUCTS).filter(item => item.category === 'Other')
      const ducks = Object.values(PRODUCTS).filter(item => item.category === 'Ducks')
      return(
        <div> 
          <Nav defaultActiveKey="/home" className="flex-column">
            <Nav.Link href="/" style={{color: "#555B6E"}}>All Products ({allProducts.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({office.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({household.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({food.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({other.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({clothes.length})</Nav.Link>
            <Nav.Link href="/" style={{color: "#555B6E"}}>Clothes ({ducks.length})</Nav.Link>
          </Nav>
        </div>
      )
    }
  }

export default Left;
